import React, {useEffect, useState} from "react";
import {Button, Footer, Navbar} from "../webcomponent";
import {
    Card,
    CardBody,
    IconButton,
    Typography,
} from "@material-tailwind/react";
import {Link, useNavigate} from "react-router-dom";
import axios, {axiosPrivate} from "../../api/axios";
import { ArrowRightIcon, ArrowLeftIcon } from "@heroicons/react/24/outline";
import useAuth from "../../hooks/useAuth";


const Orders = () => {

    const {auth, setAuth} = useAuth();

    const [list, setList] = useState(null);
    const [page, setPage] = useState(1);
    const [fetch, setFetch] = useState(5);

    useEffect(() => {
        const getDetails = async () => {

            try {
                let response = await axios.get(`/orders?page=${page}&fetch=${fetch}`,
                    {
                        headers: {
                            'Content-Type': 'application/json',
                            'Authorization': `Bearer ${auth?.access_token}`
                        },
                    }
                );
                setList(response.data);
            } catch (error) {
                if (error.response?.data.code === 404) {
                    setList([])
                }
            }

        }

        getDetails().then();

    }, [page]);

    const navigate  = useNavigate() ;

    function DefaultPagination() {
        const [active, setActive] = useState(list?.meta?.current_page);
        const [numbers, setNumbers] = useState([]);

        useEffect(() => {
            let listItems = []
            for (let i = 1; i < list?.meta?.total_pages + 1; i++) {
                listItems.push(
                    <IconButton
                        key={i}
                        variant={active === i ? "filled" : "text"}
                        className={active === i ? "bg-main-purple text-white" : "text-black"}
                        onClick={() => {
                            setActive(i)
                            setPage(i)
                        }}
                    >
                        {i}
                    </IconButton>
                );
            }
            setNumbers(listItems)
        }, [active]);

        const next = () => {
            if (active === list?.meta?.total_pages) return;
            setPage(active + 1);
            setActive(active + 1);
        };

        const prev = () => {
            if (active === 1) return;
            setPage(active - 1);
            setActive(active - 1);
        };

        return (
            <div className="flex items-center gap-4">
                <Button
                    variant="text"
                    className="flex items-center gap-2"
                    onClick={prev}
                    disabled={active === 1}
                >
                    <ArrowLeftIcon strokeWidth={2} className="h-4 w-4" /> Previous
                </Button>
                <div className="flex items-center gap-2">
                    {numbers}
                </div>
                <Button
                    variant="text"
                    className="flex items-center gap-2"
                    onClick={next}
                    disabled={active === list?.meta?.total_pages}
                >
                    Next
                    <ArrowRightIcon strokeWidth={2} className="h-4 w-4" />
                </Button>
            </div>
        );
    }

    return (

        <div className="flex flex-col justify-between items-center w-full overflow-hidden">

            <Navbar active="Home"/>

            <section className="flex flex-col md:flex-row  md:space-y-0 md:space-x-16 justify-items-center md:mx-0 m-20 lg:my-[5rem] h-[60vh] items-center">
                <div className="my-130">
                    <Card color="transparent" className="items-center" shadow={false}>
                        <div className="flex flex-wrap gap-4 justify-center mb-8">
                            {
                                list?.Orders.map((order, index) => (
                                    <Card className="w-96 shadow-none border-2" key={index}>
                                        <CardBody>
                                            <Typography variant="h5" color="black" className="mb-2 font-bold">
                                                Last Order Details
                                            </Typography>
                                            <Typography variant="h6" color="black" className="mb-2 font-bold">
                                                Book Details
                                            </Typography>
                                            <Typography variant="small" color="black" className="border-l pl-4 mb-2 font-bold">
                                                {order.book_id}
                                            </Typography>
                                            <Typography variant="small" color="blue-gray" className="border-l pl-4  mb-2">
                                                {order.title}
                                            </Typography>
                                            <Typography variant="h6" color="black" className="mb-2 font-bold">
                                                Order Details
                                            </Typography>
                                            <Typography variant="small" color="black" className="border-l pl-4  mb-2 font-bold">
                                                {order.order_id}
                                            </Typography>
                                            <Typography variant="small" color="blue-gray" className="border-l pl-4  mb-2">
                                                Status : {order.payment_status.toUpperCase()}
                                            </Typography>
                                            <Typography variant="small" color="blue-gray" className="border-l pl-4  mb-2">
                                                Amount : Rs. {order.price}
                                            </Typography>
                                            <Typography variant="small" color="blue-gray" className="border-l pl-4  mb-2">
                                                Qty : {order.quantity}
                                            </Typography>
                                        </CardBody>
                                    </Card>
                                ))
                            }
                        </div>

                        <DefaultPagination/>
                    </Card>
                </div>
            </section>

            <Footer/>

        </div>

    )

}

export default Orders
